A '''bird nest''' with seeds can be found while woodcutting most types of [[tree]]s, as well as several other activities. Bird nests may contain [[Tree seed|tree]] or [[fruit tree seed]]s, and also provide an [[empty nest]]. The chance of getting a bird nest from a tree is 1/256 each time you would normally get a log, regardless of the type of tree. If a nest appears while a player is cutting a tree, a chirping sound will usually be heard, and the player will get a message in the chat box stating, "''{{Colour|#ff0000|A bird's nest falls out of the tree.}}''" The nest is dropped on the ground and will despawn after 30 seconds if not picked up. [[Redwood tree]]s do not drop seed nests, and instead only drop [[clue nest]]s.

When [[woodcutting]], a roll is done to determine the type of nest the player will receive. The table contains 100 slots: 3/100 [[Bird nest (egg)|egg nest]] (one for each colour), 32/100 [[Bird nest (ring)|ring nest]], 65/100 seed nest. When wearing a [[strung rabbit foot]], five seed slots are removed, making the chances 3/95 for bird's egg, 32/95 for ring and 60/95 for seeds.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1055815273763217414|date=26 October 2018|archiveurl=https://archive.is/B74zS|archivedate=26 May 2020|quote=If you've got the rabbit foot necklace, pick number 0-94 inclusive. Otherwise, pick number 0-99 inclusive. 0 = red egg, 1 = blue egg, 2 = green egg, 3-34 = ring, otherwise it's seeds.}}

During [[bird house trapping]], at most 1 seed nest is awarded per birdhouse. The chance of getting a seed nest is improved with higher [[Hunter]] level, but is not affected by the tier of birdhouse or wearing a strung rabbit foot.

Seed nests are also rewarded from [[Managing Miscellania]] when subjects are tasked with collecting maple, teak or mahogany logs.

A [[Bird nest (Wyson)|variant]] of the seed nest is provided by [[Wyson]] in exchange for [[mole claw]]s and [[mole skin]]s. The Wyson seed nests are a separate item with a different drop table, and don't stack in the bank with regular seed nests.

==Obtaining==
*Randomly dropped while [[Woodcutting]].
**Players who equip a [[Woodcutting cape]] will have an additional 10% chance of receiving bird nests from chopping trees.
*Reward from [[Managing Miscellania]] when subjects are tasked with collecting maple, teak or mahogany logs.
*Reward from offering [[bird's egg]]s to the [[shrine]] in the [[Woodcutting Guild]].
*Received when emptying [[bird house traps]] on [[Fossil Island]].
*Received when chopping [[ent]] trunks.
*Received as a possible tip during [[Gnome Restaurant]] minigame.

