==Discontinued nests==
{{Main|Bird nest (seeds, 2005-2019)}}
The current version of seed nests were introduced on [[10 January]] [[2019]] with the [[Update:The Kebos Lowlands|release]] of the [[Farming Guild]]. All nests previously obtained would remain in banks and inventories, and all new nests obtained can now reward [[dragonfruit tree seed|dragonfruit]], [[celastrus seed|celastrus]], and [[redwood tree seed]]s. This change was made to prevent players from obtaining large quantities of the new seeds immediately upon release of the content.

